import axios from "axios";
import { SignInRequestDto,SignUpRequestDto } from "./Request/Auth";
import { error } from "console";
import { ResponseDto } from "./Response";
import { SignInResponseDto, SignUpResponseDto } from "./Response/Auth";
import { GetSignInUserResponseDto } from "./Response/User";
import { PostBoardResquestDto } from "./Request/Board";

const DOMAIN ='http://localhost:8080';


const API_DOMAIN =`${DOMAIN}/api/v1`;

const authorization =(accessToken:string)=>{
    return{headers:{Authorization:`Bearer ${accessToken}`}}
};
const SIGIN_IN_URL =()=>`${API_DOMAIN}/auth/sign-in`;
const SIGIN_UP_URL =()=>`${API_DOMAIN}/auth/sign-up`;

export const SignInRequest=async(requestBody:SignInRequestDto)=>{
    const result =await axios.post(SIGIN_IN_URL(),requestBody)
    .then(response=>{
        const responseBody:SignInResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response.data) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    })
    return result;
}   

export const SignUpRequest=async(requestBody:SignUpRequestDto)=>{

    const result =await axios.post(SIGIN_UP_URL(),requestBody)
    .then(response=>{
        const responseBody:SignUpResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response.data) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;


    });


    return result;
}

const POST_BOARD_URL =()=>`${API_DOMAIN}/board`;

export const postBoardReqest = async(requestBody:PostBoardResquestDto,accessToken:string)=>{
    const result =await axios.post(POST_BOARD_URL(),requestBody,authorization(accessToken))
    .then(response=>{
        const responseBody:PostBoardResquestDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        const responseBody:ResponseDto=error.response
    })
}







const GET_SIGN_USER_URL =()=> `${API_DOMAIN}/user`;
export const getSignInUserRequest= async(accessToken:string)=>{
    const result =await axios.get(GET_SIGN_USER_URL(),authorization(accessToken))
    .then(response=>{
        const responseBody:GetSignInUserResponseDto=response.data;
        return responseBody;
    })
    .catch(error=>{
        if(!error.response) return null;
        const responseBody:ResponseDto=error.response.data;
        return responseBody;
    });
    return result;

}

const FILE_DOMAIN =`${DOMAIN}/file`;

const FILE_UPLOAD_URL=()=>`${FILE_DOMAIN}/upload`;

const multipartFormData={headers:{'Content-Type':'multipart/form-data'}}

export const fileUploadRequest= async(data: FormData)=>{
    const result= await axios.post(FILE_UPLOAD_URL(),data,multipartFormData)
    .then(response=>{
        const responsBody:String=response.data;
        return responsBody;
    })
    .catch(error=>{
        return null;
    })
    return result;
}
